            firstName: 'Bob',
            lastName: 'Marley',
            bio: 'lorem ipsum ksjdnv skjdbnv alkhfsz asdjhfoausbfc aksjnkc',
            age: 40,
            isHappy: true
        },
        {
            id: 2,
            firstName: 'John',
            lastName: 'Doe',
            bio: 'lorem ipsum ksjdnv skjdbnv alkhfsz asdjhfoausbfc aksjnkc',
            age: 22,
            isHappy: false
        }
    ]
  render() {
    if(this.users.length > 0)
    return (<div>
        {this.users.map((el) => (<div className="user" key={el.id}>
            <h3>{el.firstName} {el.lastName}</h3>
            <p>{el.bio}</p>
            <b></b>
        </div>))}
    </div>)
    else 
        return (<div className="user">
            <h3>no users found</h3>
        </div>)
  }

}
export default Users
